  shade.setAttribute('r', r);

  svg.appendChild(shade);

  let main = wire(null, 'svg')`<circle cx=500 cy=500 fill=${style.fillColor || '#FFF'}>`;

  main.setAttribute('r', r);

  svg.appendChild(main);

